import react from "react";
import {BrowserRouter, Switch, Route} from "react-router-dom";
import Navigation from "./components/layout/Navigation"
import Home from "./components/child/Home";
import About from "./components/child/About";
import Contact from "./components/child/Contact";
import Error from "./components/child/Error";
import Books from "./components/books/Books";
import Login from "./components/auth/Login";
import AdminDashboard from "./components/auth/after-auth-admin/AdminDashboard";
import Registration from "./components/auth/Registration";
import TopNavigation from "./components/layout/TopNavigation";
import LogoSection from "./components/layout/LogoSection";
import Footer from "./components/layout/Footer";

const Router = () =>{
    return(
        <BrowserRouter>
            <TopNavigation />
            <LogoSection />
            <Navigation/>
            <Switch>
                <Route exact path="/" component={Home} />
                <Route  path="/About" component={About} />
                <Route  path="/contact" component={Contact} />
                <Route  path="/books" component={Books} />
                <Route  path="/auth/login" component={Login} />
                <Route  path="/auth/registration" component={Registration} />
                <Route  path="/auth/after-auth-admin/admin-dashboard" component={AdminDashboard} />
                <Route  component={Error} />
            </Switch>
            <Footer />
        </BrowserRouter>
    );
}
export default Router;
